const Table2 = ({ data }) => {
    return (
      <div style={{ width: '111%', border: '1px solid black' }}> {/* Réduire la largeur du conteneur à 50% */}
        <div style={{ display: 'flex', flexWrap: 'wrap' }}>
          {data.map((item) => (
            <div key={item.id} style={{ flexBasis: '10%', padding: 0 }}>
              <img src={item.imageSrc} alt={`${item.first_name}`} style={{ width: '100%', maxWidth: '150px', maxHeight: '290px' }} />
              <div>{item.email}</div>
            </div>
          ))}
        </div>
      </div>
    );
};

  export default Table2;
